import React from 'react';
import axios from 'axios';
import {Portfolioseaction, Portfoliotitle,Portfoliolist,Portfolioitem,Box,Boximg,Boxoverlay} from './style.js';
const Portfolio = () => {
	return (
		<Portfolioseaction>
			<Portfoliotitle>
				<span>My</span> Portfolio
			</Portfoliotitle>
			<Portfoliolist>
				<Portfolioitem className="active">All</Portfolioitem>
				<Portfolioitem>HTML</Portfolioitem>
				<Portfolioitem>Photoshop</Portfolioitem>
				<Portfolioitem>Wordpress</Portfolioitem>
				<Portfolioitem>Mobile</Portfolioitem>
			</Portfoliolist>

			<Box>
				<div>
					<Boximg src="/../../images/Portfolio/portfolio-img1.jpg" alt="" />
					<Boxoverlay>
						<span>Show Image</span>
					</Boxoverlay>
				</div>

			
			</Box>
		</Portfolioseaction>
	);
};
export default Portfolio;


